    //base64◊÷∑˚¥Æ◊™ªØ≥…Õº∆¨  
    public boolean GenerateImage(String imgStr)  
    {   //∂‘◊÷Ω⁄ ˝◊È◊÷∑˚¥ÆΩ¯––Base64Ω‚¬Î≤¢…˙≥…Õº∆¨  
        if (imgStr == null) //ÕºœÒ ˝æ›Œ™ø’  
            return false;  
        BASE64Decoder decoder = new BASE64Decoder();  
        try   
        {  
            //Base64Ω‚¬Î  
            byte[] b = decoder.decodeBuffer(imgStr);  
            for(int i=0;i<b.length;++i)  
            {  
                if(b[i]<0)  
                {//µ˜’˚“Ï≥£ ˝æ›  
                    b[i]+=256;  
                }  
            }  
            //…˙≥…jpegÕº∆¨  
            String imgFilePath = "D:\\newnew.png";//–¬…˙≥…µƒÕº∆¨  
            OutputStream out = new FileOutputStream(imgFilePath);      
            out.write(b);  
            out.flush();  
            out.close();  
            return true;  
        }   
        catch (Exception e)   
        {  
            return false;  
        }  
    }  
